          #BEGIN_FUNC: GROUP_MOVE
          FNAME: GROUP_MOVE
          TYPE: function
          INSTANCE: INST,VAR
          INDEX: 980
          COL_PROP: 2
          SAFETY: 0
          VAR_IN: EN, 0x00200001, , 0
          VAR_IN: SRC, 0x80cfffff, , 0
          VAR_IN: INDX_S, 0x00200040, , 0
          VAR_IN: INDX_D, 0x00200040, , 0
          VAR_IN: SIZE, 0x00200400, , 0
          VAR_OUT: ENO, 0x00000001,
          VAR_OUT: OUT, 0x80cfffff,
          #END_FUNC

          "

      let createReader =
          let dic =
              FBtext.Split('\n')
              |> Seq.filter (fun s -> not <| s.StartsWith("#"))
              |> Seq.map (fun s -> s.Trim())
              |> Seq.splitOn (fun s1 s2 -> s1.isEmpty() && not <| s2.isEmpty())
              |> Seq.map (Seq.filter (String.IsNullOrEmpty >> not) >> Array.ofSeq)
              |> Seq.map (fun fb ->
                  let fName =
                      let fnameLine = fb |> Array.find (fun l -> l.StartsWith("FNAME:"))
                      match fnameLine with
                      | RegexPattern @"FNAME: (\w+)$" [fn] ->
                          fn
                      | _ -> failwith "ERROR"
                  fName, fb )
              |> dict |> Dictionary
          dic

      let existFBXML fnameSource =
          createReader.ContainsKey(fnameSource)

      /// getFBXML FB 이름 기준으로 XML 저장 파라메터를 읽음
      let getFBXML (fnameSource, fnameTarget, instance, index) =
          let fbXml =
              createReader.[fnameSource]
              |> Array.map (function
                  | StartsWith "FNAME: " -> sprintf "FNAME: %s" fnameTarget
                  | StartsWith "INSTANCE: " -> sprintf "INSTANCE: %s" instance
                  | StartsWith "INDEX: " -> sprintf "INDEX: %d" index
                  | str -> str)
              |> String.concat "&#xA;"
          fbXml + " &#xA;"

      /// getFBXML FB 이름 기준으로 Input para 갯수를 읽어옴
      let getFBInCount (fnameSource:string) =
          let lstIn =
              createReader.[fnameSource]
              |> Array.filter (function f -> not (f.StartsWith("VAR_IN: EN")))
              |> Array.filter (function f -> f.StartsWith("VAR_IN: ") || f.StartsWith("VAR_IN_OUT: "))
              |> Array.toSeq
          let onlyIn =
              lstIn
              |> Seq.filter (function f -> f.StartsWith("VAR_IN: "))

          onlyIn.length(), lstIn.length()

      /// getFBXML FB 이름 기준으로 index 가져옴
      let getFBIndex (fnameSource:string) =
          let lstIndex =
              createReader.[fnameSource]
              |> Array.filter (function f -> f.StartsWith("INDEX: "))
              |> Array.toSeq

          lstIndex |> Seq.head |> fun f -> f.Replace("INDEX: ", "") |> int

